// ============================================================
// Import packages
import React from 'react';
import { Typography } from 'antd';
import PropTypes from 'prop-types';


// ============================================================
// Components
const Text = ({text, strong})=>{
    return (<Typography.Text strong={strong}>{text}</Typography.Text>)
};

Text.defaultProps = {
    text  : '',
}


Text.propTypes = {
    text  : PropTypes.string,

};

// ============================================================
// Exports
export {Text};
